import React from 'react';
import './App.css';

function App() {

  state = { images: [] };

  onSearchSubmit = async text => {
    const response = await Http.get('/chat/rooms', {
        params: { query: text }
      });

      this.setState({ images: response.data.result });
  }


  return (
    <div className="App">
        <div>{this.state.images}</div>
    </div>
  );
}

export default App;
